acqinfo.p:
De overdracht van het kaartenarchief van de Topografische Dienst geschiedde dus in 3 delen: 


​eerste tranche: de overdracht van 1983-1986 (in vier gedeeltes - 1983: 5.000 bladen; 1984: 30.000 bladen en 50 delen; 1985: 3.000 bladen; 1986: 4.000 bladen) vanuit Delft en Emmen naar het ARA te Den Haag, bestaande uit een deel eigen productie van de Topografische Dienst tot ca. 1932 en een deel historische kaartverzameling; samen ca. 42.000 bladen en een 50-tal delen, ontsloten via de 'voorlopige plaatsingslijst';


tweede tranche: de overdracht van 2007 vanuit Emmen naar het NA te Den Haag, bestaande uit een deel eigen productie van de Topografische Dienst vanaf ca. 1932 en een deel historische kaartverzameling; samen naar schatting ca. 38.000 bladen, met paklijst;


​derde tranche: de overdracht van 2016 vanuit Arnhem naar het NA te De Haag, hoofdzakelijk historische kaartverzameling; samen naar schatting ca. 2.000 bladen, met paklijst.

scopecontent.p:
Deze toegang bevat o.a.: 


de kartering van Zuid-Nederland en België door de Tweede Afdeling van het Topografisch Bureau en de Directie Militaire Verkenningen o.l.v. J.E. van Gorkum 1817-1829;


de driehoeksmeting van Nederland t.b.v. de topografisch-militaire kaart van Kraijenhoff;


de verschillende Topografisch-militaire kaartseries van Nederland na 1830 op de schalen 1:25.000; 1:50.000 en 1:100.000, zowel de (veld)minuut; als de gedrukte exemplaren;


diverse verzamelingen van historisch kaartmateriaal, veelal als bronmateriaal of ter documentatie verzameld.
